__NUXT_JSONP__("/houses/4", (function(a){return {data:[{house:{slug:a,id:a,house_name:"Stark of Winterfell",region_id:a,region:"North",description:"House Stark of Winterfell is a Great House of Westeros and the royal house of the Kingdom of the North. They rule over the vast region known as the North from their seat in Winterfell. It is one of the oldest lines of Westerosi nobility by far, claiming a line of descent stretching back over eight thousand years. Before the Targaryen conquest, as well as during the War of the Five Kings and early on in Daenerys Targaryen's war for Westeros, the leaders of House Stark ruled over the region as the Kings in the North.",image:"Stark.png",dir:"\u002Fhouses",path:"\u002Fhouses\u002F4",extension:".json",createdAt:"2021-11-27T17:31:22.912Z",updatedAt:"2021-11-25T23:15:35.390Z"}}],fetch:{},mutations:void 0}}(4)));